import React from "react";

export default function Colors(props) {
	const colors = {
    'Burnt Sienna': '#EF5350',
  }
	return (
		<div className="form-group">
			{colors.keys.forEach(color => {
				<p>{color}</p>
			})}
		</div>
	)
}
